import React from 'react';
import { } from 'ics'
import './styles.css'



function Header() {
    return (
        <header className="containerHeader">
            <ul id="menu-navigation-header" >
                <li>PORTFOLIO</li>
                <li>ABOUT</li>
                <li>SERVICES</li>
                <li>CONTACT</li>
            </ul>
        </header>
    )
}

export default Header;
